import Home from './Components/Home';
import Auth from './Components/Auth';

import { BrowserRouter, Routes, Link, Route } from 'react-router-dom';
import { Nav } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (

    <div  className="App">
      <BrowserRouter>
      <Nav variant="tabs">
        <Nav.Link as={Link} to="/">Página inicial</Nav.Link>
        <Nav.Link as={Link} to="/auth">Login</Nav.Link>

      </Nav>

      <Routes>
        <Route path="/" element={<Home></Home>}></Route>
        <Route path="/alunos" element={<Auth></Auth>}></Route>

      </Routes>

      </BrowserRouter>

      <h1>Aplicação desenvolvida para disciplina de TACs</h1>
      <h2>Aluno: Douglas Oliveira Marcondes Cardoso - 2043351</h2>
      <h2>Professor: Ricardo Sobjak</h2>
      <ul>Tecnologias utilizadas:</ul>
        <li>Spring Boot</li>
        <li>Node.Js</li>
        <li>Postgres</li>
        <li>MongoDb</li>
        <li>React</li>
    </div>
  );
}

export default App;
